import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import axios from 'axios';

class Frontpage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        <Carousel>
            <Carousel.Item>
            <img
            className="d-block w-100"
            src={welcome}
            />
            </Carousel.Item>
            <Carousel.Item>
            <img
                className="d-block w-100"
                src={topuser}
            />
            </Carousel.Item>
            <Carousel.Item>
            <img
                className="d-block w-100"
                src={usercount}
            />
            </Carousel.Item>
        </Carousel>
    }
}

export default Frontpage;
